def most_frequent_element(lst):
    count_dict = {}
    for num in lst:
        if num in count_dict:
            count_dict[num] += 1
        else:
            count_dict[num] = 1
    most_frequent = None
    highest_count = 2
    for (num, count) in count_dict.items():
        if count >= 2 and count > highest_count:
            highest_count = count
            most_frequent = num
    return most_frequent

